import StaffList from "../pages/staffManagement";
import ProjectManagement from "../pages/projectManagement/index";
import NotFound from "../pages/NotFound";
interface Router {
  name?: string;
  path: string;
  children?: Array<Router>;
  element: any;
}
//创建基础路由配置
const baseRoutes: Array<Router> = [
  {
    path: "/staffList",
    element: <StaffList />,
  },
  {
    path: "/projectManege",
    element: <ProjectManagement />,
  },
  {
    path: "/positionManage",
    element: () => import("../pages/positionManagement"),
  },
  {
    path: "/permissionManege",
    element: () => import("../pages/permissionManage"),
  },
  {
    path: "*",
    element: <NotFound />,
  },
];
//导出基础路由
export default baseRoutes;
